export const hazureSound = new Audio(
  "data:audio/wav;base64,"
);
export const atariSound = new Audio(
  "data:audio/wav;base64,"
);

export const playCorrectOrInCorrectSound = (correct: boolean) => {
  resetAudio(hazureSound)
  resetAudio(atariSound)

  const a = correct ? atariSound : hazureSound

  a.play().then()
}

const resetAudio = (a: HTMLAudioElement) => {
  a.pause()
  a.currentTime = 0
}